import React from 'react';

export default function ContactItem({ name, number, id, onRemove }) {
  return (
    <li>
      <span>{name}</span>
      <span>{number}</span>
      <button type="button" onClick={() => onRemove(id)}>
        Delete
      </button>
    </li>
  );
}
